import React from 'react';
import 'antd/dist/antd.css'; 
import PropTypes from 'prop-types';

const NodeBird = ( { Component }) => {
    return (
        <>
        <div>Common Menu</div>
        <Component />
        </>
        )
};

NodeBird.prototype = {
    Component: PropTypes.element.isRequired,
}

export default NodeBird;
